pragma solidity ^0.4.23;


contract Cert2 {

    address owner;

    mapping( uint => CertInfo ) certInfo;
    mapping( address => UserCertinfo ) usercertinfo;
    mapping( address => SignerCertInfo ) signerCertInfo;
    
    struct SignerCertInfo {
        uint[] issueID;
        mapping (uint => SignerListInfo) signerListInfo;
    }
    
    struct SignerListInfo {
        uint[] certid;
        string certname;
        string timestamp;
        uint[] signedList;
        string description;
    }

    struct UserCertinfo {
        uint[] certid;
    }
    struct CertInfo {
        address OwnerAddr;
        uint userid;
        CertCommon detail;        
        bool done;
        address swarmhash;
        bytes32 CertHash;
        bytes32 JsonHash1;
        bytes32 JsonHash2;
        bytes32 P2pLoc;  
    }
    
    struct CertCommon {
        address IssuerAddr;
       // address OrgContract;  //this contract's addr
        address[] SignerAddr;
        uint[] signer_id;
        mapping (address => SignerInfo) signer;
        string Version;
        string CertName;
        bool Revocation;
        string Description;
        string Timestamp;
    }
    
    struct SignerInfo {
        uint signer_id;
        bool status;
        string publickey;
        string signature;
    }
    
    


    constructor ()public  {
        owner = msg.sender;
    }


//issue
  

    function issue(uint issueid,uint[] certID, address[] owner_addr, bytes32[] cert_hash, bytes32[] json_hash, address issuer_addr, address[] signer_addr, 
    string version, string cert_name, string description, string timestamp, bool revocation)public {
            pushusercert(owner_addr , certID);
            //check certID # equals to owner_addr
            
            if(!(certID.length == owner_addr.length) && (certID.length == cert_hash.length)) revert();
            
            CertCommon storage certCommon; 
            certCommon.Version = version;
            certCommon.CertName = cert_name;
            certCommon.Revocation = revocation;
            certCommon.Description = description;
            certCommon.Timestamp = timestamp;
            certCommon.IssuerAddr = issuer_addr;

            for (uint8 i = 0; i < signer_addr.length; i++) {
                certCommon.SignerAddr.push(signer_addr[i]);
                certCommon.signer[signer_addr[i]].status=false;
            }
            
            for (i = 0; i < certID.length; i++) {
                certInfo[certID[i]].OwnerAddr = owner_addr[i];
                certInfo[certID[i]].swarmhash = owner_addr[i]; 
                certInfo[certID[i]].CertHash = cert_hash[i];
                certInfo[certID[i]].JsonHash1 = json_hash[i];
                certInfo[certID[i]].detail = certCommon;
                certInfo[certID[i]].done = false;
            }
            
    setSignerList( issuer_addr ,  issueid, certID,  cert_name,  description,  timestamp );
    }
    
    function pushuserid(uint[] certID , uint[] userid)public {
           for(uint8 i = 0; i < certID.length; i++){
                certInfo[certID[i]].userid = userid[i];
            }
    }

    function pushusercert(address[] user_id , uint[] cert_id)public {
            for(uint8 i = 0; i < user_id.length; i++){
                usercertinfo[user_id[i]].certid.push(cert_id[i]);
            }
    }
    
    function setSignerList(address issue_addr , uint issueid, uint[] certID, string certname, string cert_description, string timestamp )public {
            signerCertInfo[issue_addr].issueID.push(issueid);
            signerCertInfo[issue_addr].signerListInfo[issueid].description = cert_description;
            signerCertInfo[issue_addr].signerListInfo[issueid].certname = certname;
            signerCertInfo[issue_addr].signerListInfo[issueid].timestamp = timestamp;
            for(uint8 i = 0; i < certID.length; i++){
                signerCertInfo[issue_addr].signerListInfo[issueid].certid.push(certID[i]);
            }
    }


    function getIssuerIssueIDList (address issue_addr )public view returns(uint[]){
        
        return (signerCertInfo[issue_addr].issueID);
    }

    function getSignedList (address issue_addr , uint issueid )public view returns(uint[]){
        
        return (signerCertInfo[issue_addr].signerListInfo[issueid].certid);
    }


    function getIssueIDList (address issue_addr)public view returns(uint[]){
        
        return (signerCertInfo[issue_addr].issueID);
    }
    
    function getIssueIDInfo (address issue_addr, uint issueid )public view returns(uint[],string,string,string,uint[]){
        
        return (signerCertInfo[issue_addr].signerListInfo[issueid].certid, signerCertInfo[issue_addr].signerListInfo[issueid].certname, signerCertInfo[issue_addr].signerListInfo[issueid].description, signerCertInfo[issue_addr].signerListInfo[issueid].timestamp, signerCertInfo[issue_addr].signerListInfo[issueid].signedList);
    }

   
    
   function getsignerstatus (uint certID ,address[] signeraddr)public view returns(bool){
        bool sigstatus;
        sigstatus = false;
        for(uint8 i=0;i<certInfo[certID].detail.SignerAddr.length;i++){
                sigstatus = certInfo[certID].detail.signer[certInfo[certID].detail.SignerAddr[i]].status;
        }
        return (sigstatus);
    }
     
    function pushsignerpublickey(uint certID , string publickey1, address signer1 , uint issueid, string sjws, uint userid )public {
            certInfo[certID].detail.signer[signer1].publickey = publickey1;
            signerCertInfo[signer1].signerListInfo[issueid].signedList.push(certID);
            certInfo[certID].detail.signer[signer1].signer_id = userid;
            certInfo[certID].detail.signer[signer1].signature = sjws;
            certInfo[certID].detail.signer[signer1].status = true;
    }
    

    function get_swarm_hash (uint certID)public view returns(address){
        return (certInfo[certID].swarmhash);
    }
    
    function getsignerpub (uint certID,address signer1)public view returns(string){
        return (certInfo[certID].detail.signer[signer1].publickey);
    }

    function getusercert (address user_id)public view returns(uint[]){
        return (usercertinfo[user_id].certid);
    }

    function getallinfo (uint certID)public view returns( bool, string, string, string, string,uint[] ){
          
        for(uint8 i =0;i<certInfo[certID].detail.SignerAddr.length;i++){
              certInfo[certID].detail.signer_id.push(certInfo[certID].detail.signer[certInfo[certID].detail.SignerAddr[i]].signer_id);
        }
        
        return (certInfo[certID].detail.Revocation, certInfo[certID].detail.Description,
        certInfo[certID].detail.Timestamp, certInfo[certID].detail.Version, certInfo[certID].detail.CertName,certInfo[certID].detail.signer_id);
    }

    function getallinfo2 (uint certID)public view returns(address,bytes32,bytes32,address,address[],uint){
        return (certInfo[certID].OwnerAddr,certInfo[certID].CertHash,certInfo[certID].JsonHash1,certInfo[certID].detail.IssuerAddr,certInfo[certID].detail.SignerAddr,certInfo[certID].userid);
    }
    
    function get_CertHash (uint certID)public view returns(bytes32){
        return (certInfo[certID].CertHash);
    }

    function getOwnerAddr (uint certID)public view returns(address){
        return certInfo[certID].OwnerAddr;
    }
    function getIssuerAddr(uint certID)public view returns(address){
        return certInfo[certID].detail.IssuerAddr;
    }
    function getContractAddr()public view returns(address){
        return this;
    }
    function getSignerAddr(uint certID)public view returns(address[]){
        return certInfo[certID].detail.SignerAddr;
    }

    function setJsonHash2(uint certID,bytes32 json_hash)public  {
        certInfo[certID].JsonHash2 = json_hash;
    }
    function getJsonHash1(uint certID)public view  returns (bytes32){
        return certInfo[certID].JsonHash1;
    }
    function getJsonHash2(uint certID)public view  returns (bytes32){
        return certInfo[certID].JsonHash2;
    }

//sign
    function sign(uint certID,  address signer_addr) public  {
        if(certInfo[certID].OwnerAddr == 0)   revert();
         
        certInfo[certID].detail.signer[signer_addr].status = true;
        bool status=true;
        for (uint8 i = 0; i < certInfo[certID].detail.SignerAddr.length; i++) {
            if( !certInfo[certID].detail.signer[certInfo[certID].detail.SignerAddr[i]].status){
                status=false;
                break;
            }
        }
        if(status==true) certInfo[certID].done=true;
    }

    function checkStatus(uint certID) public view returns (bool){
        return certInfo[certID].done;
    }

    function getsig(uint certID,address signerad) public view returns(string){
        return certInfo[certID].detail.signer[signerad].signature;
    }
    function setP2PLoc(uint certID, bytes32 location) public  {
        certInfo[certID].P2pLoc = location;
    }

    function getP2PLoc(uint certID) public view returns (bytes32) {
        return certInfo[certID].P2pLoc;
    }



}
